このハイキャスキャンセラーはワイドトレッドスペーサーと同様に、A2017Sジュラルミンから削り出し製作された超軽量高強度のチューニングパーツです。表面は強固な皮膜硬度を誇る硬質アルマイト処理されていますので、長期的に腐食や傷から性能を守ります。従来のスチール製と比較しても非常に軽く、ノーマルから比較すると著しい軽量化となるため、ハイキャス動作のカットと共にスポーツドライビングの性能向上に非常に有効です。 <br><br>※油圧メクラ付属<br><br>※本製品は競技用部品の為、装着したことによるトラブル、事故等には一切責任は負えません。 <br><br>対応車種：R32スカイライン/S13シルビア・180SX/A31セフィーロ/C33ローレル　ハイキャス装着車 <br><br>　<br><br>補強パーツ/補強パーツその他<tr><td colspan="2">
